import React from 'react';


const Footer = () => {
    return (
        <footer className='bg-dark text-white'>
            <ul className='d-flex list-unstyled justify-content-center py-3'>
                <li className='px-3'><a href="https://github.com/dianaportillo">GitHub</a></li>
                <li className='px-3'><a href="https://www.linkedin.com/in/diana-portillo-5405a7238">LinkedIn</a></li>
            </ul>
        </footer>
    )
};

export default Footer;
